import React from "react";

class Orders extends React.Component {
    constructor() {
        super();
        this.state = { test: 'Orders lists loading...', elements: [] }
      }

    componentDidMount() {
        this.OrderList()
      }

      OrderList() {
        var table = "";
        for (var i = 0; i < 5; i++) {
            table += `<section id="${i}"><p>
            <Link
            to={{
            pathname: "/child",
            data-name = "jigar"
            }}>  <a href="/child"> ${i} Checken</a> </Link>
              </p>`;
        }

        this.setState({
          test: <div dangerouslySetInnerHTML={{ __html: table }} />
        })
      } 

      render() {
        return (
          <React.Fragment>
           <div  className="flex-vertical" style={{marginLeft: "20px"}}>
           <header>
            <h1>Order Lists</h1>
          </header>
             {this.state.test}
             </div>      
          </React.Fragment>
        );
      }
    }

  export default Orders;
